import React from "react";

import useGif from "../useGif";

const Tag = () => {
  const { gif, fetchGif } = useGif();

  return (
    <div className="container">
      <h1>Gif 1</h1>
      <img width="500" src={gif} alt="Random Gif" />
      <button onClick={fetchGif}>Cari Lagi rand v2</button>
    </div>
  );
};

export default Tag;
